import React from "react";
import "./Home.scss";
import cover from "../../../netflix/moviecover.jpg"
const Card=({img})=>(
    <img src={img} alt="cover"></img>
)

const Row=(title)=>{
    <div>
        <h2>{title}</h2>

        <Card img={cover} />
    </div>
}
const Home = () => {
  return (
    <section className="home">
      <div className="banner"></div>

      <Row/>
    </section>
  );
};

export default Home;
